  },
  orderNo: {
    fontWeight: "bold",
    fontSize: 16,
    letterSpacing: 2,
  },
  orderDetails: {
    flexDirection: "row",
    alignItems: "center",
  },
  orderDate: {
    marginRight: 10,
    fontSize: 14,
  },
