    justifyContent: "center",
    alignItems: "center",
    paddingVertical: 10,
    paddingHorizontal: 20,
  },
  //   orderDetail: {
  //     width: "100%",
  //     marginBottom: 30,
  //     paddingVertical: 10,
  //   },
  productContainer: {
    borderRadius: 25,

    marginTop: 20,
    backgroundColor: "white",
    flexDirection: "row",
    alignItems: "center",
    // borderWidth: 20,
    // borderColor: "#f1f1f1",

    // marginBottom: 30,
    width: 300,
  },
  productImage: {
    height: 100,
    width: 100,
    marginRight: 10,
  },
  productDetails: {
